itorFunc\r\n  Scenario Outline: Arrays in Python TryEditor Functionality\r\n    Given The user is on the Try Editor of Arrays in Python page\r\n    When The user enters the <code> in Text Editor and clicks RUN button\r\n    Then The <alert> should be displayed\r\n\r\n    Examples: \r\n      | code          | alert                            |\r\n      | Empty         | Error message in alert window    |\r\n      | valid code    | displayed in the console         |\r\n      | Invalid code1 | nameerror pop up alert message   |\r\n      | Invalid code2 | syntaxerror pop up alert message |\r\n\r\n  @tryeditor2ArrayPython\r\n  Scenario: Redirected to Arrays in Python page\r\n    Given The user is on the Try Editor of Arrays in Python page\r\n    When the user click browser back arrow\r\n    Then the user is navigated to Arrays in Python page\r\n\r\n  @ArrayList2tryeditor\r\n  Scenario: Navigate to tryeditor window\r\n    Given the user is in Arrays Using List page\r\n    When the user clicks Try here>>> button\r\n    Then the user is navigated to tryeditor window\r\n\r\n  @ArrayListTryEditorFunc\r\n  Scenario Outline: Arrays Using List TryEditor Functionality\r\n    Given The user is on the Try Editor Arrays Using List page\r\n    When The user enters the <code> in Text Editor and clicks RUN button\r\n    Then The <alert> should be displayed\r\n\r\n    Examples: \r\n      | code          | alert                            |\r\n      | Empty         | Error message in alert window    |\r\n      | valid code    | displayed in the console         |\r\n      | Invalid code1 | nameerror pop up alert message   |\r\n      | Invalid code2 | syntaxerror pop up alert message |\r\n\r\n  @Arraytryeditor2List\r\n  Scenario: Redirected to implementation using Arrays Using List page\r\n    Given The user is on the Try Editor Arrays Using List page\r\n    When the user click browser back arrow\r\n    Then the user is navigated to Arrays using List page\r\n\r\n  @ArrayBasicOpr2tryeditor\ ks Graph Representation link\r\nThen the user is navigated to graphrepresentation page\r\n\r\n@GraphRepresentationTryherebtn\r\nScenario: Navigate to tryeditor window\r\nGiven the user is in graphrepresentation page\r\nWhen the user clicks Try here>>> button\r\nThen the user is navigated to tryeditor window\r\n\r\n@GraphRepresentationTryEditorFunction\r\nScenario Outline: Implementation of GraphRepresentation TryEditor Functionality\r\nGiven The user is on the Try Editor graphrepresentation page\r\nWhen The user enters the <code> in Text Editor and clicks RUN button\r\nThen The <alert> should be displayed\r\n   Examples: \r\n      | code        | alert | \r\n      | Empty       | Error message in alert window| \r\n      |valid code   | displayed in the console | \r\n      |Invalid code1| nameerror pop up alert message  |\r\n      |Invalid code2| syntaxerror pop up alert message | \r\n           \r\n @TryEditorToGraphRepresentation\r\nScenario: Redirected to graphrepresentation page\r\nGiven The user is on the Try Editor graphrepresentation page\r\nWhen the user click browser back arrow\r\nThen the user is navigated to graphrepresentation page\r\n\r\n@GraphtoPracticeQuestions\r\nScenario: Navigated to Practice Questions page\r\nGiven the user is in graph page\r\nWhen the user clicks Practice Questions link\r\nThen the user is navigated to Practice Questions page\r\n\r\n@GraphSignOut\r\nScenario: signout from Graph page and navigated to hone page\r\nGiven The user is in graph main page\r\nWhen the user clicks Sign out\r\nThen the user is directed to home page with message Logged out successfully\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/Selenium\/DsAlgo_BDD\/src\/test\/resources\/Feature%20files\/Graph.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Graph","id":"907ac5a4-7360-4294-8707-add2f8ddb4aa"},{"location":{"line":1,"column 1a69"}],"astNodeIds":["5fd487f8-7b1b-498d-8065-fda44f99ff2f"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/Selenium\/DsAlgo_BDD\/src\/test\/resources\/Feature%20files\/Stack.feature","data":"@Stack @DsAlgo\r\nFeature: Stack Data strucutre WorkFlow\r\n\r\n  Background: The user logged in to dsAlgo Portal and navigated to Stack Introduction Page\r\n    Given The user is in Stack main page after signing in\r\n\r\n  @Opinstack\r\n  Scenario: user navigated to Operations in Stack link\r\n    Given user is on the Stack Introduction page\r\n    When user clicks on Operations in Stack link\r\n    Then user navigated to operations in stack page\r\n\r\n  @OpinstacktotryEditor\r\n  Scenario: user navigated to tryEditor page\r\n    Given the user is in operations in stack page\r\n    When the user clicks Try here>>> button\r\n    Then the user is navigated to tryeditor window\r\n\r\n  @OpinstacktryEditorFunction\r\n  Scenario Outline: : Implementation of OP stack TryEditor Functionality\r\n    Given The user is on the tryEditor page of Opinstack\r\n    When The user enters the <code> in Text Editor and clicks RUN button\r\n    Then The <alert> should be displayed\r\n\r\n    Examples: \r\n        Examples:\r\n\r\n      | code          | alert                            |\r\n      | Empty         | Error message in alert window    |\r\n      | valid code    | displayed in the console         |\r\n      | Invalid code1 | nameerror pop up alert message   |\r\n      | Invalid code2 | syntaxerror pop up alert message |\r\n\r\n  @TryEditorToOpinstack\r\n  Scenario: user is able to navigate back to the Operations in Stack  page\r\n    Given The user is on the tryEditor page of Opinstack\r\n    When the user click browser back arrow\r\n    Then user navigated to operations in stack page\r\n\r\n  @implementation\r\n  Scenario: Navigate to implementation page\r\n    Given user is on the Stack Introduction page\r\n    When user clicks on implementations link\r\n    Then user is navigated to implementation page\r\n\r\n  @ImplementationTryherebtn\r\n  Scenario: user is able to navigate to tryEditor page of Implementation page\r\n    Given user is on the Implementation page\r\n    When the user clicks Try here>>> button\r\n    Then the user is navigated to tryeditor window\r\n\r\n  @iImplementationTryEditorFunction\r\n  Scenario Outline: : Verify TryEditor Functionality with different Input in Implementation\r\n    Given The user is on the tryEditor page of Implentation\r\n    When The user enters the <code> in Text Editor and clicks RUN button\r\n    Then The <alert> should be displayed\r\n\r\n    Examples: \r\n        Examples:\r\n\r\n      | code          | alert                            |\r\n      | Empty         | Error message in alert window    |\r\n      | valid code    | displayed in the console         |\r\n      | Invalid code1 | nameerror pop up alert message   |\r\n      | Invalid code2 | syntaxerror pop up alert message |\r\n\r\n  @TryEditorToImplementation\r\n  Scenario: user is able to navigate back to the implementation  page\r\n    Given The user is on the tryEditor page of Implentation\r\n    When the user click browser back arrow\r\n    Then user is navigated to implementation page\r\n\r\n  @applications\r\n  Scenario: Navigate to applications page\r\n    Given user is on the Stack Introduction page\r\n    When user clicks on Applications link\r\n    Then user is navigated to stack-applications page\r\n\r\n  @ApplicationsToTryEditor\r\n  Scenario: Navigate to tryEditor page\r\n    Given user is on the stack applications page\r\n    When the user clicks Try here>>> button\r\n    Then the user is navigated to tryeditor window\r\n\r\n  @ApplicationsTryEditorFunction\r\n  Scenario Outline: : Verify TryEditor Functionality with different Input in Applications\r\n    Given The user is on the tryEditor page of applications\r\n    When The user enters the <code> in Text Editor and clicks RUN button\r\n    Then The <alert> should be displayed\r\n\r\n    Examples: \r\n        Examples:\r\n\r\n      | code          | alert                            |\r\n      | Empty         | Error message in alert window    |\r\n      | valid code    | displayed in the console         |\r\n      | Invalid code1 | nameerror pop up alert message   |\r\n      | Invalid code2 | syntaxerror pop up alert message |\r\n\r\n  @TryEditorToApplications\r\n  Scenario: user navigate back to the stack-applications  page\r\n    Given The user is on the tryEditor page of applications\r\n    When the user click browser back arrow\r\n    Then user is navigated to stack-applications page\r\n\r\n  @PracticeQuestions\r\n  Scenario: Navigated to Practice Questions page\r\n    Given the user is in operations in stack page\r\n    When the user clicks Practice Questions link\r\n    Then the user is navigated to Practice Questions page\r\n\r\n  @StackSignOut\r\n  Scenario: signout from Stack page and navigated to home page\r\n    Given user is on the Stack Introduction page\r\n    When the user clicks Sign out\r\n    Then the user is directed to home page with message Logged out successfully\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/Selenium\/DsAlgo_BDD\/src\/test\/resources\/Feature%20files\/Stack.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Stack","id":"5dca633e-0a5a-4770-9262-ad6047aec818"},{"location":{"line":1,"column":8},"name":"@DsAlgo","id":"b3f48361-69f8-4470-b732-8250c6eb57d8"}],"language":"en","keyword":"Feature","name":"Stack Data strucutre WorkFlow","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"The user logged in to dsAlgo Portal and navigated to Stack Introduction Page","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is in Stack main
